webpackJsonp([0x85bff392ebac],{6784:function(e,t){e.exports={data:{post:{html:"<p>While in the U.S. of A., I picked up a $15 <a title=\"Apple - Support - iTunes Music Store Customer Service\" href=\"http://www.apple.com/support/itunes/giving_gcs.html\">iTunes Prepaid Card</a> from Target, thinking I could thus sample the lovely graces of the iTunes Music Store. However, I didn't read the fine print, which requires that I set up a Music Store account to redeem the card. Since I don't have a US credit card, and I'm too old to ask my mother to use hers, I was unable to use the card. Anyone want to buy it, payment via PayPal? Send me a mail, make me an offer I can't refuse (over $14).</p>\n<p><strong>Update:</strong> The card is sold! No more inquiries, please.</p>",fields:{title:"For Sale: iTunes Prepaid Card",date:"02 May 2004",url:"https://papascott.de/2004-05-02-for-sale-itunes-prepaid-card/"}}},pathContext:{slug:"/2004-05-02-for-sale-itunes-prepaid-card/",prev:{fields:{title:"Beach Reading",date:"26 Apr 2004",slug:"/2004-04-26-beach-reading/"}},next:{fields:{title:"Return",date:"02 May 2004",slug:"/2004-05-02-return/"}}}}}});
